import {Fragment} from "react";
import "./nav.css";
import {FaSearch}from "react-icons/fa"
import {useHistory} from "react-router-dom";
function Nav(){
    const history = useHistory();
    function awayHandler(){
        history.push("/booknow")
    }
    return (<Fragment>
        <nav>
        <div id="left">
            <h1>Traversta</h1>
            </div>
            <div id="right">
            <button className="btn-sm-w" onClick={awayHandler}>book now</button>
            <section className="text-small-w">Need Help?</section>
            <FaSearch className="icons" title="Search here"/>   
            </div>
            </nav>
        </Fragment>)
}
export default Nav
